import React from "react";
import { Link } from "react-router-dom";

export default function Navbar({ user, onLogout }) {
  return (
    <nav className="bg-blue-700 text-white px-6 py-3 flex justify-between items-center shadow-md">
      <Link to="/" className="text-2xl font-bold hover:text-yellow-300">DocuManage</Link>

      <div className="space-x-6">
        <Link to="/" className="hover:text-yellow-300">Home</Link>
        {!user && (
          <>
            <Link to="/login" className="hover:text-yellow-300">Login</Link>
            <Link to="/register" className="hover:text-yellow-300">Register</Link>
          </>
        )}
        {user && (
          <>
            <Link to="/dashboard" className="hover:text-yellow-300">Dashboard</Link>
            <Link to="/history" className="hover:text-yellow-300">History</Link>
            <button
              onClick={onLogout}
              className="bg-red-500 hover:bg-red-600 px-3 py-1 rounded"
            >
              Logout
            </button>
          </>
        )}
      </div>
    </nav>
  );
}
